public boolean maybeApplyConstraint(
    final GetObjectRequest request) {

  if (policy.getMode() == ChangeDetectionPolicy.Mode.Server
      && revisionId != null) {
    policy.applyRevisionConstraint(request, revisionId);
    return true;
  }
  return false;
}
